import React from 'react';

function Article({ article, handleDelete }) {
  return (
    <tr>
      <td>{article.id}</td>
      <td>{article.title}</td>
      <td>{article.body}</td>
      <td>{article.published ? 'Published' : 'Not Published'}</td>
      <td><button onClick={() => handleDelete(article.id)}>Delete</button></td>
    </tr>
  );
}

export default Article;
